import Table from "@mui/material/Table";
import axios from "axios";
import TableHead from "@mui/material/TableHead";
import TableBody from "@mui/material/TableBody";
import TableRow from "@mui/material/TableRow";
import TableCell from "@mui/material/TableCell";
import { useNavigate } from "react-router-dom";
import {useState,useEffect} from "react";
/*import { useEffect,useState } from "react"*/

const Complete = ({user ,setUser}) => {
  const navigate = useNavigate();
  const [item, setItems] = useState({id:'', itemName:''});

  useEffect(() => {
    axios.get("http://localhost:8080/items").then((res) => {
      setItems(res.data);
    });
  }, []);


  return (
    <div>신청되셨습니다. 곧 연락 드리겠습니다.
      <table>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>유저 id user_id</TableCell>
            <TableCell>신청 서비스 service</TableCell>
            <TableCell>가격 price</TableCell>
            <TableCell>남은 크레딧 left_credits</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          <TableRow>
            <TableCell>{user.username}</TableCell>
            <TableCell>{user.credit}</TableCell>
            <TableCell>{item.id}</TableCell>
              <TableCell>{item.itemName}</TableCell>
            <TableCell></TableCell>
            <TableCell></TableCell>
          </TableRow>
        </TableBody>
      </Table>
  </table>
</div>
  )
}


export default Complete
